import React from "react";
import axios from "axios";
import Link from "next/link";

class My_mainitems extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/my_main_items")
      .then(response => {
        return {
          hasErrored: false,
          my_main_itemsData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      my_main_itemsData: props.my_main_itemsData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <div className="container dwi-div dwi-card">
        <div className="row">
          <div className="card-deck">
            <div className="card col-4 cardmin margintopbottom">
              <ul>
                {this.state.my_main_itemsData.map(my_main_items => (
                  <li key={my_main_items.id}>
                    {my_main_items.name} {my_main_items.salePrice}{" "}
                    {my_main_items.numberOfBottles}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>
    );
  }
}


export default My_mainitems;
